css:
.nuclide-http-request-sender-headers {
  display: flex;
  height: 20em;
  border: 1px solid rgba(0, 0, 0, 0.5);
  border-radius: 2px;
  padding: 10px;
  overflow: auto;
}
.nuclide-http-request-sender-button-group {
  display: flex;
  flex-direction: row-reverse;
  padding: 10px;
}
.nuclide-edit-request-method-select {
  margin-bottom: 0.75em;
}
.nuclide-parameter-container {
  display: flex;
  justify-content: space-between;
}
.nuclide-parameter-container .nuclide-parameter-button {
  height: 2.5em;
  width: 6%;
}
.nuclide-parameter-input-container {
  display: flex;
  justify-content: space-between;
  width: 92%;
}
.nuclide-parameter-input-container > * {
  width: 49%;
}
